import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Button from 'react-bootstrap/Button';
import { NavLink } from 'react-router-dom';

const Header = () => {
  return (
    <>
      <Navbar bg="light" data-bs-theme="light">
        <Container>
          <div>
            <h3 className="mt-2 h3_right" style={{ color: "#6c63ff" }}>
              <Nav.Link href="#home">Satyam Kumar</Nav.Link>
            </h3>
          </div>

          <Nav className="">
            <div>
              <NavLink to="/" className= "text-decoration-none" style> Home</NavLink>
              <NavLink href="/About"className= "text-decoration-none">About</NavLink>
              <NavLink href="/Contact"className= "text-decoration-none">Contact</NavLink>
              <NavLink href="/playlist"className= "text-decoration-none">Playlist</NavLink>
            </div>
            <div>
            <Button variant="danger">Resume</Button>
            </div>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
